import "../About.css";
import background_image from "../images/background.png";
import TransitionBtn from "../TransitionBtn";

function About() {
  new Scroll('.wrap', {
  stages: [{
    id: 'basic',
    scrollNumber: 60,
    transition: 0,
    items: [{
      id: 'slow',
      effects: [{
        property: 'transform',
        start: 'translateY(0px)',
        end: 'translateY(-50px)'
      }]
    }, {
      id: 'fast',
      effects: [{
        property: 'transform',
        start: 'translateY(0px)',
        end: 'translateY(-180px)'
      }]
    }]
  }]
})
    return (
      <div className="wrap" id="About"  style={{ 
        position:"relative",
        height:"100vh"

      }} >
        <TransitionBtn navUrl="Recruitment"/>
        <div data-scroll-stage-id="basic">
        <div className="title"     data-aos="fade-right"
         data-aos-anchor-placement="top" data-scroll-item-id="slow">
          <h1>ABOUT</h1>
        </div>

        <div className="p1" 
        data-aos="fade-up"
        data-aos-delay="100"
        data-aos-duration="500"
        data-aos-anchor-placement="top">
          <p> 
          Ever feel like what you learn in the classroom is
          deeply theoretical, with little opportunities to build
          out practical applications?
          </p>
        </div>
        <div className="p2" 
         data-aos="fade-up"
         data-aos-delay="100"
         data-aos-duration="500"
         data-aos-anchor-placement="top" data-scroll-item-id="fast">
          <p>
          DevX is a student organization dedicated to solving
          that very problem! We comprise of several project
          teams building out real-world projects to help tackle
          pressing problems frustrating the UCLA community.
          Make your ideas come to life, grow your technical
          skills by pairing up with experienced students, and
          build a network that lasts beyond graduation. 
          </p>
        </div>
        </div>
      </div>
  );
}
export default About;
